        <Marker latitude={42.2153} longitude={20.7415}>
        <IoMdPin style={{color: "#caa14e", fontSize: "20px"}}/> Prizren
        </Marker>
        <Marker latitude={42.8914} longitude={20.8660}>
        <IoMdPin style={{color: "#caa14e", fontSize: "20px"}}/> Mitrovica
