      onViewportChange={
          viewport => {
              setViewport(viewport);
          }}>
        <Marker
        longitude={20.8660}
        latitude={42.891}
        >
            <div onClick={e => {
                e.preventDefault();
                setSelectedCity("Mitrovica")
            }} style={{fontSize: "30px", color: "#caa14e"}}><MdLocationOn /></div>
        </Marker>
        <Marker
        longitude={21.1655}
        latitude={42.6629}>
            <div 
            onClick={e => {
                e.preventDefault();
                setSelectedCity("Pristina")
            }}
            style={{fontSize: "30px", color: "#caa14e"}}><MdLocationOn /></div>
        </Marker>
        <Marker
        longitude={20.7415}
        latitude={42.2153}>
            <div 
            onClick={e => {
                e.preventDefault();
                setSelectedCity("Prizren")
            }}
            style={{fontSize: "30px", color: "#caa14e"}}><MdLocationOn /></div>
        </Marker>
        <Marker
        longitude={20.2887}
        latitude={42.6593}
        >
        <div  onClick={e => {
            e.preventDefault();
            setSelectedCity("Peja")
        }} style={{fontSize: "30px", color: "#caa14e"}}><MdLocationOn /></div>
        </Marker>
      </ReactMapGL>


</div>
    )
}
